import './home.css'; // Import the CSS

function Home() {
  return (
    <div className="home-container">
      <div className="home-card">
        <h1 className="home-title">Welcome to Price Scout</h1>
        <p className="home-subtitle">Find the best prices across all stores easily!</p>
      </div>
    </div>
  );
}

export default Home;
